CREATE TABLE `la` (
  `id` int(11) NOT NULL auto_increment,
  `updated` char(1) NOT NULL default '0',
  `location` varchar(255) NOT NULL default '',
  `filename` varchar(255) NOT NULL default '',
  `artist` varchar(255) NOT NULL default '',
  `song` varchar(255) NOT NULL default '',
  `genre` varchar(255) NOT NULL default '',
  `decade` smallint(6) NOT NULL default '0',
  `downloads` tinyint(4) NOT NULL default '0',
  `filesize` int(11) NOT NULL default '0',
  `album` varchar(50) NOT NULL default '',
  KEY `id` (`id`)
) TYPE=MyISAM PACK_KEYS=0 AUTO_INCREMENT=22324 ;


